description:
She's Got It All, But The Whore, Wants More!

These girls look classy, but watch what happens when they try to get sassy. Lindsey Meadows and Miko Sinz get maxed out when John Strong takes charge. Sasha Grey and Candace Raines get their designer jeans soaked with Mike Adriano's bean cream, while Micah Moore and Riley Shy get more than they bargained for. It's over two hours of trust fund babes getting spoiled like the little brats they are. So what are you waiting for? They've got it all, but these whores just keep wanting more!

